import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider } from './hooks/useTheme';
import './styles/globals.css';

function App() {
    return (
        <ThemeProvider>
            <Router>
                <div className="App">
                    <h1>Test with Router</h1>
                </div>
            </Router>
        </ThemeProvider>
    );
}

export default App;
